"ListTags":null,"Total":0,"ID":48},{"RowNumber":2,"TypeID":null,"Title":"Lễ kỷ niệm 60 năm ngày thành lập Thư viện tỉnh Hoà Bình (28/11/1956 - 28/11/2016)","TitleAscii":"le-ky-niem-60-nam-ngay-thanh-lap-thu-vien-tinh-hoa-binh-28-11-1956-28-11-2016","DateCreated":"2017-03-29T16:23:09.687","DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Viewed":null,"Summary":"<p style=\"margin-top: 2px; margin-bottom: 2px; padding: 0px; color: rgb(51, 51, 51); font-family: Tahoma, Arial, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-size: 16px;\"><span style=\"font-family: &quot;times new roman&quot;, times, serif;\">Sáng 2/12/2016, Thư viện tỉnh Hòa Bình trọng thể tổ chức Lễ kỷ niệm 60 năm ngày thành lập (28/11/1956- 28/11/2016).</span></span></p><p style=\"margin-top: 2px; margin-bottom: 2px; padding: 0px; color: rgb(51, 51, 51); font-family: Tahoma, Arial, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-size: 16px;\"><span style=\"font-family: &quot;times new roman&quot;, times, serif;\">Tham dự Lễ kỷ niệm có đại diện lãnh đạo Vụ Thư viện - Bộ Văn hoá, Thể thao và Du lịch (VHTTDL), đại diện Thư viện Quốc gia Việt Nam, lãnh đạo Sở VHTTDL tỉnh Hòa Bình, một số thư viện tỉnh, thành phố, các Sở, Ban, Ngành của Tỉnh và các thế hệ viên chức đã và đang công tác tại Thư viện tỉnh Hòa Bình.</span></span></p>","Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"ListPictureID":null,"ListGroupID":null,"ListTagID":null,"Picture":{"Name":null,"FileName":"636264013591560110_2016-12-05-hb-01.jpg","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"Link":null,"Alt":null,"Summary":null,"Size":null,"IsShow":null,"IsDeleted":null,"TypeID":null,"ImageExists":null,"ID":0},"ArticleType":{"Name":"Tin tức","NameAscii":"tin-tuc","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Summary":null,"Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"Parent":null,"TotalArticle":null,"ListGroupID":null,"ParentName":null,"ParentAscii":null,"UrlPicture":null,"ListChildID":null,"ID":0},"ListPicture":null,"ListTags":null,"Total":0,"ID":42},{"RowNumber":3,"TypeID":null,"Title":"Tham luận của Giám đốc VNU-LIC tại hội thảo “Phát triển và chia sẻ nguồn tài liệu số nhằm hỗ trợ hoạt động của Quốc hội vì sự phát triển bền vững tại Việt Nam”","TitleAscii":"tham-luan-cua-giam-doc-vnu-lic-tai-hoi-thao-phat-trien-va-chia-se-nguon-tai-lieu-so-nham-ho-tro-hoat-dong-cua-quoc-hoi-vi-su-phat-trien-ben-vung-tai-viet-nam","DateCreated":"2017-04-24T10:45:38.603","DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Viewed":null,"Summary":"Tham luận của Giám đốc VNU-LIC tại hội thảo “Phát triển và chia sẻ nguồn tài liệu số nhằm hỗ trợ hoạt động của Quốc hội vì sự phát triển bền vững tại Việt Nam”<br>","Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"ListPictureID":null,"ListGroupID":null,"ListTagID":null,"Picture":{"Name":null,"FileName":"636286270272529309_1.jpg","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"Link":null,"Alt":null,"Summary":null,"Size":null,"IsShow":null,"IsDeleted":null,"TypeID":null,"ImageExists":null,"ID":0},"ArticleType":{"Name":"Tin tức","NameAscii":"tin-tuc","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Summary":null,"Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"Parent":null,"TotalArticle":null,"ListGroupID":null,"ParentName":null,"ParentAscii":null,"UrlPicture":null,"ListChildID":null,"ID":0},"ListPicture":null,"ListTags":null,"Total":0,"ID":61},{"RowNumber":4,"TypeID":null,"Title":"Hội thảo khoa học “Thư viện thế kỷ XXI: Hướng tới cổng kiến thức”","TitleAscii":"hoi-thao-khoa-hoc-thu-vien-the-ky-xxi-huong-toi-cong-kien-thuc","DateCreated":"2017-03-29T16:38:07.133","DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Viewed":null,"Summary":"<div class=\"article-content\" style=\"font-size: 11px; color: rgb(51, 51, 51); font-family: Tahoma, Arial, sans-serif;\"><p style=\"margin-top: 2px; margin-bottom: 2px; padding: 0px; text-align: justify;\"><span style=\"font-size: 16px;\"><span style=\"font-family: &quot;times new roman&quot;, times, serif;\">Ngày 30/9/2016 tại Hà Nội, Trung tâm Thông tin và Dự báo Kinh tế - Xã hội Quốc gia thuộc Bộ Kế hoạch và Đầu tư đã tổ chức Hội thảo khoa học “Thư viện thế kỷ XXI: Hướng tới cổng kiến thức”. Đây là diễn đàn để những người làm việc trong lĩnh vực thông tin – thư viện trình bày, trao đổi các kết quả nghiên cứu, chia sẻ những kinh nghiệm, học tập các mô hình quản lý thư viện hiện đại trong thời đại công nghệ số, để xây dựng thư viện các Bộ, Ngành thích ứng với tiến bộ khoa học và công nghệ của thế kỷ XXI.</span></span></p></div>","Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"ListPictureID":null,"ListGroupID":null,"ListTagID":null,"Picture":{"Name":null,"FileName":"636264022375283097_2016-09-30-01.jpg","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"Link":null,"Alt":null,"Summary":null,"Size":null,"IsShow":null,"IsDeleted":null,"TypeID":null,"ImageExists":null,"ID":0},"ArticleType":{"Name":"Tin tức","NameAscii":"tin-tuc","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Summary":null,"Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"Parent":null,"TotalArticle":null,"ListGroupID":null,"ParentName":null,"ParentAscii":null,"UrlPicture":null,"ListChildID":null,"ID":0},"ListPicture":null,"ListTags":null,"Total":0,"ID":47},{"RowNumber":5,"TypeID":null,"Title":"Hội nghị - Hội thảo: Sơ kết 02 năm thực hiện Đề án “Đẩy mạnh các hoạt động học tập suốt đời trong các thư viện, bảo tàng, nhà văn hoá, câu lạc bộ”","TitleAscii":"hoi-nghi-hoi-thao-so-ket-02-nam-thuc-hien-de-an-day-manh-cac-hoat-dong-hoc-tap-suot-doi-trong-cac-thu-vien-bao-tang-nha-van-hoa-cau-lac-bo","DateCreated":"2017-03-29T16:32:59.6","DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Viewed":null,"Summary":"<p style=\"margin-top: 2px; margin-bottom: 2px; padding: 0px; color: rgb(51, 51, 51); font-family: Tahoma, Arial, sans-serif; font-size: 11px; text-align: justify;\"><span style=\"font-family: &quot;times new roman&quot;, times, serif; font-size: 16px;\">Đề án “Xây dựng xã hội học tập giai đoạn 2012-2020” được Thủ tướng Chính phủ phê duyệt năm 2013 với mục tiêu “trong xã hội học tập, mọi cá nhân có trách nhiệm học tập thường xuyên, suốt đời, tận dụng mọi cơ hội học tập để làm người công dân tốt; có nghề, lao động với hiệu quả ngày càng cao; học cho bản thân và những người xung quanh hạnh phúc; học để góp phần phát triển quê hương, đất nước và nhân loại”..</span></p>","Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"ListPictureID":null,"ListGroupID":null,"ListTagID":null,"Picture":{"Name":null,"FileName":"636264018747595334_2016-11-01-htsd-00.jpg","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"Link":null,"Alt":null,"Summary":null,"Size":null,"IsShow":null,"IsDeleted":null,"TypeID":null,"ImageExists":null,"ID":0},"ArticleType":{"Name":"Tin tức","NameAscii":"tin-tuc","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Summary":null,"Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"Parent":null,"TotalArticle":null,"ListGroupID":null,"ParentName":null,"ParentAscii":null,"UrlPicture":null,"ListChildID":null,"ID":0},"ListPicture":null,"ListTags":null,"Total":0,"ID":46},{"RowNumber":6,"TypeID":null,"Title":"Hội nghị chuyên đề lần thứ Nhất góp ý xây dựng Tiêu chuẩn quốc gia “Thông tin và Tư liệu - Giao dịch mượn liên thư viện”","TitleAscii":"hoi-nghi-chuyen-de-lan-thu-nhat-gop-y-xay-dung-tieu-chuan-quoc-gia-thong-tin-va-tu-lieu-giao-dich-muon-lien-thu-vien","DateCreated":"2017-03-29T16:30:40.137","DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Viewed":null,"Summary":"<div class=\"article-content\" style=\"font-size: 11px; color: rgb(51, 51, 51); font-family: Tahoma, Arial, sans-serif;\"><p style=\"margin-top: 2px; margin-bottom: 2px; padding: 0px; text-align: justify;\"><span style=\"font-size: 16px;\"><span style=\"font-family: &quot;times new roman&quot;, times, serif;\">Thực hiện nhiệm vụ của Bộ Văn hoá, Thể thao và Du lịch giao cho Thư viện Quốc gia Việt Nam (TVQG) triển khai các Dự án xây dựng Tiêu chuẩn quốc gia, ngày 9/11/2016, TVQG tổ chức Hội nghị chuyên đề lần thứ Nhất nhằm mục đích trao đổi, thảo luận, tiếp nhận các ý kiến góp ý của các nhà khoa học, các nhà quản lý, chuyên gia trong lĩnh vực thư viện, thông tin, tiêu chuẩn đối với Dự thảo lần 2 TCVN \"<em>Thông tin và tư liệu - Giao dịch mượn liên thư viện</em>\"...&nbsp;</span></span></p></div>","Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"ListPictureID":null,"ListGroupID":null,"ListTagID":null,"Picture":{"Name":null,"FileName":"636257020369080253_2017-03-01-hndc2-02.jpg","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"Link":null,"Alt":null,"Summary":null,"Size":null,"IsShow":null,"IsDeleted":null,"TypeID":null,"ImageExists":null,"ID":0},"ArticleType":{"Name":"Tin tức","NameAscii":"tin-tuc","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Summary":null,"Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"Parent":null,"TotalArticle":null,"ListGroupID":null,"ParentName":null,"ParentAscii":null,"UrlPicture":null,"ListChildID":null,"ID":0},"ListPicture":null,"ListTags":null,"Total":0,"ID":45},{"RowNumber":7,"TypeID":null,"Title":"Lễ kỷ niệm 43 năm truyền thống và 20 năm thành lập khoa Thông tin - Thư viện, trường Đại học Khoa học Xã hội và Nhân văn - Đại học Quốc gia Hà Nội (1996 - 2016)","TitleAscii":"le-ky-niem-43-nam-truyen-thong-va-20-nam-thanh-lap-khoa-thong-tin-thu-vien-truong-dai-hoc-khoa-hoc-xa-hoi-va-nhan-van-dai-hoc-quoc-gia-ha-noi-1996-2016","DateCreated":"2017-03-29T16:28:04.177","DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Viewed":null,"Summary":"<div class=\"article-content\" style=\"font-size: 11px; color: rgb(51, 51, 51); font-family: Tahoma, Arial, sans-serif;\"><p style=\"margin-top: 2px; margin-bottom: 2px; padding: 0px; text-align: justify;\"><span style=\"font-size: 16px;\"><span style=\"font-family: &quot;times new roman&quot;, times, serif;\">Sáng 11/11/2016, khoa Thông tin - Thư viện, trường Đại học Khoa học Xã hội và Nhân văn - Đại học Quốc gia Hà Nội tổ chức Lễ kỷ niệm 43 năm truyền thống và 20 năm thành lập (1996 - 2016)...</span></span></p></div>","Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"ListPictureID":null,"ListGroupID":null,"ListTagID":null,"Picture":{"Name":null,"FileName":"636264015782735606_2016-11-11-01.jpg","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"Link":null,"Alt":null,"Summary":null,"Size":null,"IsShow":null,"IsDeleted":null,"TypeID":null,"ImageExists":null,"ID":0},"ArticleType":{"Name":"Tin tức","NameAscii":"tin-tuc","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Summary":null,"Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"Parent":null,"TotalArticle":null,"ListGroupID":null,"ParentName":null,"ParentAscii":null,"UrlPicture":null,"ListChildID":null,"ID":0},"ListPicture":null,"ListTags":null,"Total":0,"ID":44},{"RowNumber":8,"TypeID":null,"Title":"Đại hội Hội Thư viện Việt Nam nhiệm kỳ III (2016 - 2021)","TitleAscii":"dai-hoi-hoi-thu-vien-viet-nam-nhiem-ky-iii-2016-2021","DateCreated":"2017-03-29T16:25:22.357","DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Viewed":null,"Summary":"<div class=\"article-content\" style=\"font-size: 11px; color: rgb(51, 51, 51); font-family: Tahoma, Arial, sans-serif;\"><p style=\"margin-top: 2px; margin-bottom: 2px; padding: 0px; text-align: justify;\"><span style=\"font-size: 16px;\"><span style=\"font-family: &quot;times new roman&quot;, times, serif;\">Ngày 25/11/2016, tại Thư viện Quốc gia Việt Nam đã diễn ra Đại hội đại biểu Hội Thư viện Việt Nam nhiệm kỳ III. Sau 10 năm hoạt động, Hội đã phát triển mới được 3 Liên Chi hội, 10 Chi hội, thu hút mới hơn 2.000 hội viên nâng tổng số hội viên lên 5.700 và 2.030 hội viên tập thể. Hội đã góp phần xây dựng thành công Đề án Ngày Sách Việt Nam; Góp ý với Chính phủ về vấn đề Hiệp định TPP, nhiều văn bản khác ở cấp Bộ và tham gia thẩm định xã hội nhiều đề tài nghiên cứu khoa học. Vai trò của Hội ngày càng được khẳng định thông qua sự chỉ đạo năng động, sáng tạo, nhanh nhạy, thiết thực của Ban Thường vụ, Ban Thường trực…</span></span></p></div>","Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"ListPictureID":null,"ListGroupID":null,"ListTagID":null,"Picture":{"Name":null,"FileName":"636264014217635971_2016-11-25-01.jpg","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"Link":null,"Alt":null,"Summary":null,"Size":null,"IsShow":null,"IsDeleted":null,"TypeID":null,"ImageExists":null,"ID":0},"ArticleType":{"Name":"Tin tức","NameAscii":"tin-tuc","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Summary":null,"Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"Parent":null,"TotalArticle":null,"ListGroupID":null,"ParentName":null,"ParentAscii":null,"UrlPicture":null,"ListChildID":null,"ID":0},"ListPicture":null,"ListTags":null,"Total":0,"ID":43},{"RowNumber":9,"TypeID":null,"Title":"Thư viện Sóc Trăng: Khai mạc Hội báo Xuân Đinh Dậu 2017","TitleAscii":"thu-vien-soc-trang-khai-mac-hoi-bao-xuan-dinh-dau-2017","DateCreated":"2017-03-29T16:21:01.877","DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"SEOTitle":null,"SEODescription":null,"SEOKeyword":null,"PictureID":null,"Viewed":null,"Summary":"<div class=\"article-content\" style=\"font-size: 11px; color: rgb(51, 51, 51); font-family: Tahoma, Arial, sans-serif;\"><p style=\"margin-top: 2px; margin-bottom: 2px; padding: 0px; text-align: justify;\"><span style=\"font-size: 16px;\"><span style=\"font-family: &quot;times new roman&quot;, times, serif;\">Ngày 21/01/2017, Thư viện tỉnh Sóc Trăng phối hợp với Hội Nhà báo, Báo Sóc Trăng, Hội Văn học Nghệ thuật, Sở Thông tin và Truyền thông, Đài Phát thanh-Truyền hình tỉnh Sóc Trăng tổ chức khai mạc Hội báo Xuân Đinh Dậu 2017. Với hơn 100 tên sách có chủ đề “Học tập và làm theo tư tưởng, đạo đức, phong cách Hồ Chí Minh”, 300 ấn phẩm báo, tạp chí, gần 100 tác phẩm nhiếp ảnh nghệ thuật đạt giải về những thành tựu kinh tế, văn hóa, xã hội của tỉnh Sóc Trăng cùng hoạt động trưng bày và biểu diễn nghệ thuật thư pháp, Hội báo Xuân diễn ra sôi nổi và thu hút đông đảo người dân trong và ngoài Tỉnh tham dự.</span></span></p></div>","Detail":null,"Number":null,"IsShow":null,"IsDeleted":null,"ListPictureID":null,"ListGroupID":null,"ListTagID":null,"Picture":{"Name":null,"FileName":"636264012110875403_2017-01-24-01.jpg","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":null,"Link":null,"Alt":null,"Summary":null,"Size":null,"IsShow":null,"IsDeleted":null,"TypeID":null,"ImageExists":null,"ID":0},"ArticleType":{"Name":"Tin tức","NameAscii":"tin-tuc","DateCreated":null,"DateUpdated":null,"UpdatedBy":null,"CreatedBy":nu